import React from 'react'
import classes from './Layout.module.css'


class Layout extends React.Component {
  render() {
    return(
      <div className={classes.Layout}>
        <h1>sdfsdfsdf</h1>
        <i className="fas fa-camera"></i>
        <main>
          { this.props.children }
        </main>
      </div>
    )
  }
}

export default Layout
